import "./home.css"

const Home = () => (
  <div>
    <img
      src="/home.jpg"
      alt="Anuka Photos Banner"
      style={{
        position: 'fixed',
        top: '100px',  // header height
        left: '50%',
        transform: 'tra0nslateX(-50%)',
        width: '50%',
        maxWidth: '350px',
        height: 'auto',
        zIndex: 900, // below header's 1100
      }}
    />
    {/* Add padding-bottom or margin to container if you want scrollable space below */}
  </div>
);

export default Home
